void clear_screen(){
	int x, y;
	// run through all the pixels with black
	for (x=0; x<320; x++){
		for (y=0; y<240; y++){
			plot_pixel(x, y, 0x0000);
		}
	}
}

void wait_for_vsync(){
	// pixel controller
	volatile int * pixel_ctrl_ptr = 0xFF203020;
	register int status;
	//start the synchronization process
	// request to swap the buffers
	*pixel_ctrl_ptr = 1;
	// wait for s to become 0
	status = *(pixel_ctrl_ptr+3);
	while ((status & 0x01) != 0){
		status = *(pixel_ctrl_ptr +3);
	}
}

void draw_background(){
    int count =0;
    for (int y =0; y<240; y++){
        for (int x =0; x<320; x++){
		if ((ECE243ProjectBackground_map[count])+ (ECE243ProjectBackground_map[count+1]<<8)!= 0x0000){
	            plot_pixel(x,y, (ECE243ProjectBackground_map[count])+ (ECE243ProjectBackground_map[count+1]<<8));
		}
	count= count+2;
    	}
    }
}